import React from 'react';
// import logo from './logo.svg';
import './App.css';
import ExpenseItem from './components/ExpenseItem';

function App() {
  const expenses = [
    {title: 'Toilet Paper', amount: 294.67, date: new Date(2022, 11, 19)},
    {title: 'Car Insuarance', amount: 1000.67, date: new Date(2021, 11, 16)},
    {title: 'New T.V', amount: 5000.67, date: new Date(2019, 11, 12)},
    {title: 'New Desk', amount: 1100.67, date: new Date(2018, 11, 10)},
  ]

  return (
    <div className="App">
      <h2>Let's get started</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
